import React from 'react';
import './index.scss';
import { Success } from './components/Success';
import { Users } from './components/Users';
import axios from 'axios';

// Тут список пользователей: https://reqres.in/api/users

function App() {
  var items = 0;
  const isLoading = 0;
  axios.get('https://reqres.in/api/users').then(res => (items = res.data.data));
  console.log(items);
  return (
    <div className="App">
      <Users items={items} isLoading={isLoading} />
      {/* <Success /> */}
    </div>
  );
}

export default App;
